import React, { useState } from 'react';

const AddLogModal = () => {
    const [message, setMessage] = useState('')
    const [attention, setAttention] = useState(false)
    const [tech, setTech] = useState('')

    const onSubmit = () => {
        console.log(message, attention, tech);
    }

    return (
        <div id='add-log-modal' className="modal" style={modalStyle}>
            <div className="modal-content">
                <h4>Enter System Log</h4>

                <div className="row">
                    <div className="input-field">
                        <input type="text" name="message" value={message} onChange={e => setMessage(e.target.value)} />
                        <label htmlFor="message" className="active"> Log Message </label>
                    </div>
                </div>

                <div className="row">
                    <div className="input-field">
                        <select name="tech" value={tech} className="browser-default" onChange={e => setTech(e.target.value)}>
                            <option value="" disabled> Select Technician </option>
                            <option value="Md Rony"> Md Rony </option>
                            <option value="Md Najmul"> Md Najmul </option>
                            <option value="Md Robiul"> Md Robiul </option>
                            <option value="Md Arif"> Md Arif </option>
                        </select>
                    </div>
                </div>

                <div className="row">
                    <div className="input-field">
                        <p>
                            <label htmlFor="">
                                <input type="checkbox" className="filled-in" checked={attention} value={attention} onChange={e => setAttention(e.target.value)} />
                                <span>needs Attention</span>
                            </label>
                        </p>
                    </div>
                </div>

            </div>
            <div className="modal-footer">
                <a href="#!" onClick={onSubmit} className="modal-close waves-effect waves-green btn-flat"> Enter </a>
            </div>
        </div>
    );
};

const modalStyle = {
    width: '75%',
    height: '75%'
}

export default AddLogModal;
